import{_ as a,o as t,c as l,R as i}from"./chunks/framework.S1SDgkSw.js";const _=JSON.parse('{"title":"快速入门3-自定义连接器","description":"","frontmatter":{"title":"快速入门3-自定义连接器","date":"2023-07-17T17:47:06.000Z"},"headers":[],"relativePath":"doc/wpdoc/快速入门3-自定义连接器.md","filePath":"doc/wpdoc/快速入门3-自定义连接器.md"}'),e={name:"doc/wpdoc/快速入门3-自定义连接器.md"},n=i('<h1 id="快速入门3-自定义连接器" tabindex="-1">快速入门3 - 自定义连接器 <a class="header-anchor" href="#快速入门3-自定义连接器" aria-label="Permalink to &quot;快速入门3 - 自定义连接器&quot;">​</a></h1><p>本文档将通过定义一个高德接口的连接器，来展示系统的基本操作和概念。<br> 通过此文档，你会学会：<br> 1：如何新建应用连接器<br> 2：如何设置连接器<br> 3：如何配置连接</p><p>插件开发请参考此文档 <a href="https://co12n8yb1k.feishu.cn/docs/doccn2PGrDSwP1JrVKziBg6g1Xd" target="_blank" rel="noreferrer">玄武iPaaS插件开发文档</a></p><h2 id="_1-基本概念" tabindex="-1">1. 基本概念 <a class="header-anchor" href="#_1-基本概念" aria-label="Permalink to &quot;1\\. 基本概念&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">名词概念</th><th style="text-align:center;">释义</th></tr></thead><tbody><tr><td style="text-align:center;">连接器</td><td style="text-align:center;">指对一个应用的对外交互接口的封装，通常由该应用的多个行为组成。如玄武AI连接器，数据库连接器等</td></tr><tr><td style="text-align:center;">行为</td><td style="text-align:center;">即连接器行为，又分为执行行为和触发行为。如翻拍识别，SKU识别等；执行行为用于执行一个应用的接口；触发行为用于监听或接收应用的消息。</td></tr><tr><td style="text-align:center;">执行行为</td><td style="text-align:center;">用于执行一个应用的接口，一个连接器会有多个执行行为，即完成某项或多项业务任务的行为。</td></tr><tr><td style="text-align:center;">触发行为</td><td style="text-align:center;">触发行为用于监听或接收应用的消息，一个连接器仅有一个触发行为，处于连接器的第一个节点，有了触发行为，执行行为才会执行。</td></tr><tr><td style="text-align:center;">插件</td><td style="text-align:center;">指玄武丝路iPaaS平台开发人员使用Java语言编写的，包含了应用的登录，执行等方法的jar包（Java档案文件），是一种压缩文件。</td></tr><tr><td style="text-align:center;">资源</td><td style="text-align:center;">插件编写好后，上传注册到玄武丝路iPaaS平台上，就成为了资源；连接方法注册为链接资源，执行方法注册为执行资源。在玄武丝路iPaaS平台上，用户对资源的选择和使用可以实现个性化配置集成流。</td></tr></tbody></table><h2 id="_2-新建连接器" tabindex="-1">2. 新建连接器 <a class="header-anchor" href="#_2-新建连接器" aria-label="Permalink to &quot;2\\. 新建连接器&quot;">​</a></h2><p>首先新增一个应用连接器</p><ol><li>选择【连接器】模块</li><li>点击【新建应用连接器】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/ab.png" alt=""></li><li>填写名称，名称必须全局唯一</li><li>选择分类</li><li>设置图标，可上传图片或者使用内置图标库</li><li>点击【下一步】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/ac.png" alt=""></li><li>填写版本号</li><li>点击【下一步】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/ad.png" alt=""></li><li>上传插件</li><li>资源预览，插件校验成功才会显示资源列表</li><li>点击【确认】，系统就会新建一个应用连接器<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/ae.png" alt=""><br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/af.png" alt=""></li></ol><h2 id="_3-设置连接器" tabindex="-1">3. 设置连接器 <a class="header-anchor" href="#_3-设置连接器" aria-label="Permalink to &quot;3\\. 设置连接器&quot;">​</a></h2><h3 id="_3-1-设置执行行为" tabindex="-1">3.1 设置执行行为 <a class="header-anchor" href="#_3-1-设置执行行为" aria-label="Permalink to &quot;3.1 设置执行行为&quot;">​</a></h3><ol><li>点击【名称&amp;说明】，进入连接器详情页面<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/1q.png" alt=""></li><li>选择【执行行为】，在进入连接器详情页面时，默认选择【执行行为】</li><li>点击【行为名称】，进入执行行为的设置页面<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/2q.png" alt=""></li><li>设置入参</li><li>设置出参</li><li>点击【保存】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/3q.png" alt=""><br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/4q.png" alt=""></li></ol><h3 id="_3-2-设置触发行为" tabindex="-1">3.2 设置触发行为 <a class="header-anchor" href="#_3-2-设置触发行为" aria-label="Permalink to &quot;3.2 设置触发行为&quot;">​</a></h3><ol><li>选择【触发行为】</li><li>点击【新建触发行为】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/1r.png" alt=""></li><li>填写行为名称，选择分类</li><li>点击【添加参数】，并设置入参</li><li>点击【保存】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/2r.png" alt=""></li></ol><h3 id="_3-3-连接设置" tabindex="-1">3.3 连接设置 <a class="header-anchor" href="#_3-3-连接设置" aria-label="Permalink to &quot;3.3 连接设置&quot;">​</a></h3><p>当连接器需要授权后才能使用时，就需要进行连接设置，用于设置授权信息。</p><ol><li>选择【连接设置】</li><li>设置连接器参数</li><li>点击【保存】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/1t.png" alt=""></li></ol><h2 id="_4-发布连接器" tabindex="-1">4. 发布连接器 <a class="header-anchor" href="#_4-发布连接器" aria-label="Permalink to &quot;4\\. 发布连接器&quot;">​</a></h2><ol><li>点击【发布】，系统就会启用该连接器<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/1y.png" alt=""></li></ol><h2 id="_5-添加版本" tabindex="-1">5. 添加版本 <a class="header-anchor" href="#_5-添加版本" aria-label="Permalink to &quot;5\\. 添加版本&quot;">​</a></h2><ol><li>点击【添加新版本】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/0z.png" alt=""></li><li>填写版本号</li><li>点击【下一步】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/1z.png" alt=""></li><li>上传插件<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/2z.png" alt=""></li><li>资源预览，插件检验成功即可预览资源列表</li><li>点击【确认】，系统就会添加一个新的版本<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/3z.png" alt=""><br> 点击【发布】后，系统就会启用新版本的连接器</li><li>点击【版本号】可查看该连接器的所有版本<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/4z.png" alt=""></li></ol><h2 id="_6-更新资源" tabindex="-1">6. 更新资源 <a class="header-anchor" href="#_6-更新资源" aria-label="Permalink to &quot;6\\. 更新资源&quot;">​</a></h2><ol><li>点击【更新资源】<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/1m.png" alt=""></li><li>上传插件</li><li>资源预览，插件检验成功即可预览资源列表</li><li>点击【确认】，系统就会更新资源<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/2m.png" alt=""><br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/3m.png" alt=""></li></ol><h2 id="_7-连接配置" tabindex="-1">7. 连接配置 <a class="header-anchor" href="#_7-连接配置" aria-label="Permalink to &quot;7\\. 连接配置&quot;">​</a></h2><p>大部分的连接器都需要对应的连接才能使用，连接可以是账号密码，也可能是调用凭证。</p><ol><li>选择【连接配置】模块</li><li>点击【新建连接】，进入连接配置页面。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/1l.png" alt=""></li><li>选择所属连接器</li><li>输入连接名称，方便辨识</li><li>输入租户key和租户日配额，以及redis配置</li><li>点击【确定】按钮保存连接设置。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/2l.png" alt=""></li></ol>',25),r=[n];function o(c,p,s,h,d,m){return t(),l("div",null,r)}const b=a(e,[["render",o]]);export{_ as __pageData,b as default};
